import getMimesisIcon from '../../../shared/assets/icons/getMimesisIcon';
import MimesisIcon from '../../../shared/assets/icons/mimesis-icon.svg';
import cls from './MimesisComponent.module.scss';

export const MimesisComponent = () => {
  const icon = getMimesisIcon('#0312F9');
  return (
    <div className={cls.MimesisComponent}>
      <div className={cls.header}>
        {icon}
        <MimesisIcon />
        <h1>Мимесиc</h1>
      </div>
    </div>
  );
};
